from locust import HttpLocust, TaskSet
import json


def syncdata(l_object):
    json_data = {"Request": "cn4eH0n6TuxD2NpN..kIiOij0DuPnJmWpbUKjF9A=="}
    l_object.client.post("/easy-assist/sync/", json_data)


def index(l_object):
    l_object.client.get("/")


def login(l_object):
    l_object.client.get("/easy-assist/sales-ai/login/")


class UserBehavior(TaskSet):

    tasks = {index: 2, login: 1}

    def on_start(self):
        syncdata(self)


class WebsiteUser(HttpLocust):
    task_set = UserBehavior
